def custom_fib(signature, indexes, n):
    stack = deque([(signature, 0)])
    visited = {tuple(signature)}
    while stack:
        cur_signature, i = stack.popleft()
        if i >= n:
            return cur_signature[i]
        for j in indexes:
            if 0 <= j < len(cur_signature):
                next_signature = list(cur_signature)
                next_signature.append(cur_signature[j] + (cur_signature[k] for k in indexes if k != j and 0 <= k < len(cur_signature)).sum())
                next_signature_tuple = tuple(next_signature)
                if next_signature_tuple not in visited:
                    stack.append((next_signature, i + 1))
                    visited.add(next_signature_tuple)
    return None

