def custom_fib(signature, indexes, n):
    queue = deque([(signature, 0)])
    seen = set(tuple(signature))
    while queue:
        cur, idx = queue.popleft()
        if len(cur) > n:
            continue
        if len(cur) == n:
            return cur[-1]
        for i in range(len(cur)):
            if i not in indexes:
                continue
            new = list(cur)
            new.append(sum(new[j] for j in [k-1 for k in indexes if k > 0 and k - 1 < len(new)]))
            new = tuple(new)
            if new not in seen:
                seen.add(new)
                queue.append((new, idx + 1))

