def custom_fib(signature, indexes, n): 
    q = deque([(signature, [n - 1])])
    visited = {tuple(signature)}
    while q:
        seq, path = q.popleft()
        if len(seq) == n:
            return sum(seq)
        for i in range(len(seq), n):
            new_seq = seq + [sum([seq[j] for j in path])]
            new_path = path + [i]
            if tuple(new_seq) not in visited:
                q.append((new_seq, new_path))
                visited.add(tuple(new_seq))

