def custom_fib(signature, indexes, n):
    queue = deque([(signature, 0)])
    seen = {tuple(signature)}
    while queue:
        nums, i = queue.popleft()
        if i == n-1:
            return nums[i]
        for j in range(len(nums)-1):
            if j in indexes:
                for k in range(len(nums)-1):
                    if k in indexes:
                        next_nums = list(nums)
                        next_nums.append(nums[k] + nums[j])
                        if tuple(next_nums) not in seen:
                            queue.append((next_nums, i+1))
                            seen.add(tuple(next_nums))

